        description: "\u0417\u0430\u0434\u0435\u043A\u043E\u0440\u0438\u0440\u043E\u0432\u0430\u043B\u0438 \u043D\u0438\u0448\u0443, \u0440\u0430\u0437\u043C\u0435\u0441\u0442\u0438\u0432 \u0432 \u043D\u0435\u0439 \u0448\u043A\u0430\u0444\u0447\u0438\u043A \u0441\u043E \u0441\u0442\u0435\u043A\u043B\u044F\u043D\u043D\u044B\u043C\u0438 \u043F\u043E\u043B\u043A\u0430\u043C\u0438 \u0438 \u043F\u043E\u0434\u0441\u0432\u0435\u0442\u043A\u043E\u0439. \u0417\u0430\u0434\u043D\u044F\u044F \u0441\u0442\u0435\u043D\u043A\u0430 \u0432\u044B\u043F\u043E\u043B\u043D\u0435\u043D\u0430 \u0438\u0437 \u0448\u043F\u043E\u043D\u0430 \u043E\u0440\u0435\u0445\u0430. \u0418\u043C\u0435\u0435\u0442\u0441\u044F \u0442\u0430\u043A\u0436\u0435 \u0437\u0430\u043A\u0440\u044B\u0442\u0430\u044F \u0441\u0435\u043A\u0446\u0438\u044F \u0441 \u0434\u0432\u0435\u0440\u0446\u0435\u0439, \u0442\u0430\u043A \u0447\u0442\u043E \u0444\u0443\u043D\u043A\u0446\u0438\u043E\u043D\u0430\u043B\u044C\u043D\u043E \u043C\u043E\u0436\u043D\u043E \u0438\u0441\u043F\u043E\u043B\u044C\u0437\u043E\u0432\u0430\u0442\u044C \u043D\u0435 \u0442\u043E\u043B\u044C\u043A\u043E \u0434\u043B\u044F \u0434\u0435\u043A\u043E\u0440\u0430, \u043D\u043E \u0438 \u0434\u043B\u044F \u0445\u0440\u0430\u043D\u0435\u043D\u0438\u044F. \u041A\u043E\u043D\u0441\u0442\u0440\u0443\u043A\u0446\u0438\u044F \u043B\u0435\u0433\u043A\u0430\u044F \u0438 \u0432\u043E\u0437\u0434\u0443\u0448\u043D\u0430\u044F, \u043D\u043E , \u0441\u043E\u0433\u043B\u0430\u0441\u0438\u0442\u0435\u0441\u044C, \u0442\u0430\u043A\u0438\u0435 \u044D\u043B\u0435\u043C\u0435\u043D\u0442\u044B \u0432\u043D\u043E\u0441\u044F\u0442 \u0432 \u043E\u0431\u0441\u0442\u0430\u043D\u043E\u0432\u043A\u0443 \u044D\u043B\u0435\u0433\u0430\u043D\u0442\u043D\u043E\u0441\u0442\u044C, \u0438\u0437\u044B\u0441\u043A\u0430\u043D\u043D\u043E\u0441\u0442\u044C \u0438  \u043D\u043E\u0442\u043A\u0443 \u0430\u0440\u0438\u0441\u0442\u043E\u043A\u0440\u0430\u0442\u0438\u0437\u043C\u0430.",
